export const OPEN_LARGE_WINDOW = 'OPEN_LARGE_WINDOW';
export const CLOSE_LARGE_WINDOW = 'CLOSE_LARGE_WINDOW';
export const OPEN_SMALL_WINDOW = 'OPEN_SMALL_WINDOW';
export const CLOSE_SMALL_WINDOW = 'CLOSE_SMALL_WINDOW';

export const openLargeWindow = () => {
    return {
        type: OPEN_LARGE_WINDOW
    }
}

export const closeLargeWindow = () => {
    return {
        type: CLOSE_LARGE_WINDOW
    }
}

export const openSmallWindow = () => {
    return {
        type: OPEN_SMALL_WINDOW
    }
}

export const closeSmallWindow = () => {
    return {
        type: CLOSE_SMALL_WINDOW
    }
}
